import axios from "axios";
import cheerio from "cheerio";

const IndicesScrape = (url) => {
    axios({
        method: 'get',
        headers: { "Access-Control-Allow-Origin": "*" },
        url: url
    })
        .then(res => {
            const htmlResponse = res.data
            console.log(htmlResponse)
        })
}

export default IndicesScrape;
